package misc

import (
	"github.com/ethereum/go-ethereum/common"

	"github.com/flare-foundation/coreth/core/state"
	"github.com/flare-foundation/coreth/params"
)

var priceSubmitterUpgrade = CoreContractUpdate{
	Address: params.ValidationAddress,
	Old:     common.Hex2Bytes(""),
	New:     common.Hex2Bytes(""),
}

func PriceSubmitterUpgraded(statedb *state.StateDB) bool {
	return updateApplied(statedb, priceSubmitterUpgrade)
}

func UpgradePriceSubmitter(statedb *state.StateDB) {
	applyUpdate(statedb, priceSubmitterUpgrade)
}
